    function openBigfileDownDialog(file_key){
        $("#bigFileDownload").css("display", "");
	$("#file_key").val(file_key);

	$("#encrtptBody").scrollTop($(document).height());

    function checkBigfileDown(){
        var userInputPassword = $.trim($("#filePassword").val());
	var file_key = $("#file_key").val();
	var secuparm = $("#secuparm").val();

	if (userInputPassword == '') {
		alert("비밀번호를 입력해주세요.");

	}
	securityChk.bigFileDown('https://webmail.kbfg.com/kbmail',secuparm,userInputPassword,file_key);
    }
